import React from "react";
import {
    Button,
    Dialog, DialogActions, DialogContent, DialogTitle
} from "@mui/material";

export default class MaterialDialog extends React.Component {
    render() {
        return (
            <div>
               <Dialog
               >
                   <DialogTitle>
                       My Title                  
                   </DialogTitle>
                   <DialogContent>
                        Do you agree with the content
                   </DialogContent>
                   <DialogActions>
                       <Button>
                           Agree
                       </Button>
                   </DialogActions>
               </Dialog>
            </div>
        )
    }
}
